using yourInvoice.Common.Business.CatalogModule;
using yourInvoice.Common.Integration.ZapSign;

namespace yourInvoice.Common.UnitTest
{
    public class ZapsignModuleUnitTest
    {
        private readonly Mock<ICatalogBusiness> mockICatalogRepository = new Mock<ICatalogBusiness>();

        [Fact]
        public void Zapsign_ShouldCreateOnZapSign()
        {
            // documento en base64
            string base64 = "";
            string url = "https://sandbox.api.zapsign.com.br/";
            string uri = "api/v1/docs/";
            string token = "7dd3fe35-4a9f-4630-8062-fbcf828e4bb9af2f8b38-c110-4d80-81d6-ec844ccde318";
            // Act
            Zapsign zap = new Zapsign(this.mockICatalogRepository.Object);
            var result = zap.CreateDoc(url, uri, token, new ZapsignFileRequest() { base64_pdf = base64, externalId = Guid.NewGuid().ToString(), name = "Oferta mercantil.pdf", Signers = new List<ZapsignSignerRequest>() { new ZapsignSignerRequest() { name = "Pedro Perez", email = "pedro.perez@Proj.com" } } });

            // Assert
            Assert.NotNull(result);
            Assert.NotNull(result.token);
        }

        [Fact]
        public void Zapsign_ShouldAddAtachmentOnZapSign()
        {
            // documento en base64
            string base64 = "";
            string url = "https://sandbox.api.zapsign.com.br/";
            string uriCreate = "api/v1/docs/";
            string uriAttachment = "api/v1/docs/{{original_doc_token}}/upload-extra-doc/";
            string token = "7dd3fe35-4a9f-4630-8062-fbcf828e4bb9af2f8b38-c110-4d80-81d6-ec844ccde318";
            // Act
            Zapsign zap = new Zapsign(this.mockICatalogRepository.Object);
            var docPrincipal = zap.CreateDoc(url, uriCreate, token, new ZapsignFileRequest() { base64_pdf = base64, externalId = Guid.NewGuid().ToString(), name = "Oferta mercantil.pdf", Signers = new List<ZapsignSignerRequest>() { new ZapsignSignerRequest() { name = "Pedro Perez", email = "pedro.perez@Proj.com" } } });

            var uriText = uriAttachment.Replace("{{original_doc_token}}", docPrincipal.token);
            var docAttachment = zap.AddAttachment(url, uriText, token, new ZapsignFileAttachmentRequest() { name = "atachmentDocTest", base64_pdf = base64 });

            // Assert
            Assert.NotNull(docAttachment);
            Assert.NotNull(docAttachment.token);
        }

        [Fact]
        public void Zapsign_ShouldGetDetailOnZapSign()
        {
            // documento en base64
            string base64 = "";
            string url = "https://sandbox.api.zapsign.com.br/";
            string uriCreate = "api/v1/docs/";
            string uriAttachment = "api/v1/docs/{{original_doc_token}}/upload-extra-doc/";
            string uriDetail = "api/v1/docs/{{doc_token}}/";
            string token = "7dd3fe35-4a9f-4630-8062-fbcf828e4bb9af2f8b38-c110-4d80-81d6-ec844ccde318";
            // Act
            Zapsign zap = new Zapsign(this.mockICatalogRepository.Object);
            var docPrincipal = zap.CreateDoc(url, uriCreate, token, new ZapsignFileRequest() { base64_pdf = base64, externalId = Guid.NewGuid().ToString(), name = "Oferta mercantil.pdf", Signers = new List<ZapsignSignerRequest>() { new ZapsignSignerRequest() { name = "Pedro Perez", email = "pedro.perez@Proj.com" } } });

            var uriText = uriAttachment.Replace("{{original_doc_token}}", docPrincipal.token);
            var docAttachment = zap.AddAttachment(url, uriText, token, new ZapsignFileAttachmentRequest() { name = "atachmentDocTest", base64_pdf = base64 });

            uriDetail = uriDetail.Replace("{{doc_token}}", docPrincipal.token);
            var docDetail = zap.GetDetail(url, uriDetail, token);

            // Assert
            Assert.NotNull(docDetail);
            Assert.NotNull(docDetail.token);
        }
    }
}